  render() {


    return(
      this.props.menu.map((item, index) => (
        <div className="col-3 mb-4">
          <div key={index} className="card">
            <img className='card-img-top' style={{filter: 'brightness(50%)'}}src={item.image} alt={item.menu_item}/>
